import React, { useState, useEffect } from "react";
import InsightsDashboard from "./components/InsightsDashboard";
import { Insights } from "./types/insights";
import "./App.css";

function App() {
  const [insights, setInsights] = useState<Insights | null>(null);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const loadInsights = async () => {
      try {
        setLoading(true);
        setError(null);

        // Try to load from the public directory first
        const response = await fetch("/vl_insights.jsonl");

        if (!response.ok) {
          throw new Error(
            `Failed to load insights: ${response.status} ${response.statusText}`
          );
        }

        const text = await response.text();
        const lines = text
          .trim()
          .split("\n")
          .filter((line) => line.trim());

        if (lines.length === 0) {
          throw new Error("No insights data found");
        }

        // Parse the last line (most recent insights)
        const latestInsights = JSON.parse(lines[lines.length - 1]);
        setInsights(latestInsights);
      } catch (err) {
        console.error("Error loading insights:", err);
        setError(err instanceof Error ? err.message : "Unknown error occurred");
      } finally {
        setLoading(false);
      }
    };

    loadInsights();

    // Set up polling to refresh insights every 30 seconds
    const interval = setInterval(loadInsights, 30000);

    return () => clearInterval(interval);
  }, []);

  return (
    <div className="min-h-screen" style={{ background: 'linear-gradient(135deg, #f8fafc 0%, #e2e8f0 100%)' }}>
      {/* Professional Header */}
      <header className="bg-white shadow-sm border-b border-gray-200">
        <div className="container mx-auto px-6 py-4">
          <div className="flex items-center justify-between">
            <div className="flex items-center space-x-4">
              <div className="w-10 h-10 bg-gradient-to-br from-blue-600 to-blue-700 rounded-xl flex items-center justify-center">
                <svg className="w-6 h-6 text-white" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
                </svg>
              </div>
              <div>
                <h1 className="text-2xl font-bold text-gray-900">Advanced Analytics Engine</h1>
                <p className="text-sm text-gray-600">Real-time correlation & anomaly detection</p>
              </div>
            </div>
            <div className="flex items-center space-x-4">
              <div className="flex items-center space-x-2 text-sm text-gray-600">
                <div className="w-2 h-2 bg-green-500 rounded-full animate-pulse"></div>
                <span>Live</span>
              </div>
              <div className="text-sm text-gray-500">
                {new Date().toLocaleTimeString()}
              </div>
            </div>
          </div>
        </div>
      </header>

      {/* Main Content */}
      <main className="container mx-auto px-6 py-8">
        <InsightsDashboard
          insights={insights}
          loading={loading}
          error={error}
        />
      </main>

      {/* Professional Footer */}
      <footer className="bg-white border-t border-gray-200 mt-16">
        <div className="container mx-auto px-6 py-6">
          <div className="flex items-center justify-between text-sm text-gray-600">
            <div className="flex items-center space-x-4">
              <span>© 2024 Advanced Analytics Engine</span>
              <span>•</span>
              <span>Powered by AI/ML</span>
            </div>
            <div className="flex items-center space-x-4">
              <span>Last updated: {insights ? new Date(insights.timestamp).toLocaleString() : 'N/A'}</span>
            </div>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default App;
